	public function getSearchURL($query,$category = false,$subcat=false){
		return "http://www.kaunsa.com/Search/";
	}
	public function getLogo(){
		return "http://www.kaunsa.com/images/logo.png";
	}
	public function getData($html,$query,$category,$subcat){
		$data = array();
		phpQuery::newDocumentHTML($html);
		//echo $html;die;
		if(pq('.list')){
			foreach(pq('.list') as $div){
				$image = pq($div)->children('.pro_block')->children('.pro_pic')->find('a:first')->html();
				$url = pq($div)->children('.pro_block')->children('.pro_pic')->find('a:first')->attr('href');
				$name = pq($div)->children('.pro_block')->children('.pro_txt')->find('a:first')->html();
				$disc_price = pq($div)->children('.pro_block')->children('.pro_btm_container')->find('.pro_price')->html();
				$shipping = '';
				$offer = '' ;
				$stock = 0;
				$cat ='';
				$author = '';
				$data[] = array(
						'name'=>$name,
						'image'=>$image,
						'disc_price'=>$disc_price,
						'url'=>$url,
						'website'=>$this->getCode(),
						'offer'=>$offer,
						'shipping'=>$shipping,
						'stock'=>$stock,
						'author' => $author,
						'cat' => $cat
				);
			}
		}
		$data2 = array();
		foreach($data as $row){
			$html = $row['image'];
			$html .= '</img>';
			phpQuery::newDocumentHTML($html);
			$img = pq('img')->attr('src');
			if(strpos($img, 'http') === false){
				$img = $this->getWebsiteUrl().$img;
			}
			$row['image'] = $img;
			$data2[] = $row;
		}
		$data2 = $this->cleanData($data2, $query);
		$data2 = $this->bestMatchData($data2, $query,$category,$subcat);
		return $data2;
	}
